                                fireEvent('callEvents', {
                                    type: 'CALL_ERROR',
                                    errorCode: 7000,
                                    errorMessage: 'Call Peer is Disconnected!',
                                    errorInfo: webpeers[peer]
                                });

                                removeFromCallUI(peer.substring(3));
